import React from 'react'
const images = "./ImageDirectories/16TeamsPhotos"

function TournamentPhotos() {
  return (
    <div>
        <div className="max-w-md mx-auto p-4">
            <h1 className="text-3xl font-bold mb-4">Image Gallery</h1>
            <div className="flex flex-wrap justify-center">
                {images.map((image, index) => (
                <img
                    key={index}
                    src={image.url}
                    alt={`Image ${index + 1}`}
                    className="w-48 h-48 m-2 rounded-lg shadow-md"
                />
                ))}
            </div>
            </div>
    </div>
  )
}

export default TournamentPhotos
